import Header from './components/Header.js';
import Formulaire from './components/Formulaire';
import Proposition from './components/Proposition';
import Cartes from './components/Cartes';
import CartLes from './components/Cartes';


function App() {
  return (
    <div className="App">
      <Header titre="Boite à idée" />
      <Formulaire />
      <Proposition titre="La liste des propostions" />
      <Cartes monTitre="mon titre" maDescription="ce sont mes descriptions" />
    </div>
  );
}

export default App;
